import Layout from '../components/Layout';

const About = () => {
  return (

    <div>
      <Layout>
        <Link href="/">
          <a>Home page</a>
        </Link>
        <p>About page</p>
        <p>This is content about page</p>
      </Layout>
    </div>
  );
}

export default About;
